import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css'


class DisplayList extends React.Component {

  constructor(props) {
    super(props);
  }
  // each of these items will have an add to cart button
  // we will filter which ones are in the cart
  render() {
    return (
      <div>
        {this.props.list.map(
          (item) =>
          <div class="card">
            <h2>{item.name}</h2>
          </div>
        )}
      </div>
    )
  }

}

export default DisplayList;
